import React from 'react'
import './Progress.css'
export const Progress = ({
    progress
}) => {
    const Parentdiv = {
        height: 30,
        width: '95%',
        borderRadius: 15,
        backgroundColor: "lightGray",
    }

    const Childdiv = {
        height: '100%',
        width: `${progress - 5}%`,
        borderRadius: 40,
        textAlign: 'right',
        paddingInline:10,
        backgroundColor: "aqua",
    }

    const progresstext = {
        color: 'black', 
        fontWeight: 500,
        marginTop:"50%"

    }

    return (
        <div style={Parentdiv}>
            <div style={Childdiv}>
             <span style={progresstext}>{`${progress}%`}</span>
            </div>
        </div>
    )
}
